import React from 'react'
import { Pie, PieChart,toolTipContent } from 'recharts'


function Genderchart() {
   
  {
  
    const data =[
      {name: "Male",value:13,fill:"grey"},
      {name:"Female",value:10,fill:"maroon"},
      {name:"Required",value:5,fill:"orange"},
    ];
     return(
      <div className='chart'>
    <center><h1 id="h">Genderchart</h1></center>
    <div>
    <center><PieChart width={400} height={500}id='piechart' >
  <Pie 
    dataKey="value"
    data={data} 
    innerRadius={110}
    outerRadius={170}
    toolTipContent= {"<b>{label}</b>:{name}%"}
    indexLabel={"{label} - {y}%"}

    />
    </PieChart></center></div>
      </div>
      
    )
   
  }
}


export default Genderchart
